import React from 'react';
import Box from '@mui/material/Box';


export default function Follower() {
    return (
        <Box 
        sx={{ width: '98%', bgcolor: 'background.paper' }} 
        textAlign='center' 
        style={{ margin : 5, position:'relative'}}>
            <p>Followers</p>
        </Box>
    )
}
